  true,\n\t\"url\": null,\n\t\"notes\": \"Global Multihazard Mortality Risks and Distribution
  is a 2.5 minute grid identifying and nncharacterizing the nature of multihazard
  risk at the global scale. For this study, multihazard considers the hazards posed
  by nncyclones, droughts, earthquakes, floods, landslides and volcanoes. The specific
  hazards are grouped into the following hazard nncategories: drought (drought), seismic
  (earthquakes and volcanoes), and hydro (cyclones, floods, and landslides). Each
  grid cell is nnassessed for each hazard category; and is considered at high risk
  or not at high risk. Treated as a binary value, the at-risk values nnof the hazards
  categories function as a 3-digit index of multihazard. For each of the hazard category
  combinations, aggregate nnanalyses determine the total population, area, and length
  of major transportation features, as well as, the value of Gross Domestic nnProduct
  (GDP) and agricultural GDP. This dataset is the result of collaboration among the
  Columbia University Center for Hazards and nnRisk Research (CHRR), International
  Bank for Reconstruction and Development/The World Bank, and Columbia University
  Center for nnInternational Earth Science Information Network (CIESIN).\",\n\t\"license_title\":
